// src/components/MyEvents.js
import React from "react";
import { Link } from "react-router-dom";

const MyEvents = () => {
  // Sample data for events with image URLs
  const events = [
    {
      id: 1,
      name: "Community Cleanup",
      date: "2024-10-10",
      imageUrl:
        "data:image/png;base64,",
    },
    {
      id: 2,
      name: "Local Concert",
      date: "2024-10-15",
      imageUrl:
        "data:image/jpeg;base64,",
    },
  ];

  return (
    <div className="container mx-auto p-4">
      {events.length > 0 ? (
        <ul className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          {events.map((event) => (
            <li key={event.id} className="card bg-base-100 shadow-xl">
              <figure>
                <img
                  src={event.imageUrl}
                  alt={event.name}
                  className="w-full h-48 object-cover"
                />
              </figure>
              <div className="card-body">
                <h2 className="card-title">{event.name}</h2>
                <p>Date: {event.date}</p>
                <div className="card-actions justify-end">
                  <Link to={`/event-details/${event.id}`}>
                    <button className="btn btn-accent">Show Details</button>
                  </Link>
                </div>
              </div>
            </li>
          ))}
        </ul>
      ) : (
        <p className="text-center text-lg">No events found.</p>
      )}
    </div>
  );
};

export default MyEvents;
